import React from 'react';

const TimeReportDetail = () => {
  return (
    <div>
      <h1>Tidsrapport Detaljer</h1>
      <p>Här visas detaljer för en specifik tidsrapport.</p>
    </div>
  );
};

export default TimeReportDetail;
